import React from 'react';
import styled from 'styled-components';
import { faTimes } from '@fortawesome/free-solid-svg-icons'

const Button = styled.button`
  width: 50px;
  height: 50px;
  border-radius: 50%;
  margin:0 50px;
  border: none;
  background: #ccc;
`;

const Navigation = () => <faTimes/>;

export default Navigation;
